import styled from "styled-components";

export const Input = styled.input`
  .input {
    width: 80%;
    margin: 0 auto;
    padding: 10px;
    border: none;
    margin-bottom: 10px;
    border-radius: 50px;
  }
`;
export const Div = styled.div``;
